import * as React from 'react'
import {StyleSheet, Text } from 'react-native'

const GetStarted = ({navigation}) => {
    return (
        <>
            <Text>Intro</Text>
            <Text>How to use the app</Text>
        </>
    )
}

export default GetStarted
